export default function EventPage(){
    const products=[
        {id:'p1',title:"event1"},
        {id:'p2',title:"event2"},
        {id:'p3',title:"event3"}
    ]
    return (
        <>
        <h1>EventPage</h1>
        {products.map((event)=>{
            return (
<li key={event.id}>
    <Link to={`/events/:${event.id}`}>{event.title}</Link>
</li>
            )
        })}
        </>
    )
}
